CREATE DEFINER=`root`@`localhost` PROCEDURE `searchPlayerName`(IN playerNameToFind varchar(255))
BEGIN

    SELECT DISTINCT (PlayerName), Pos, Team
    FROM playerpassing 
    WHERE PlayerName LIKE CONCAT('%',playerNameToFind,'%')
    UNION
    SELECT DISTINCT (PlayerName), Pos, Team
    FROM playerreceiving
    WHERE PlayerName LIKE CONCAT('%',playerNameToFind,'%')
    UNION
    SELECT DISTINCT (PlayerName), Pos, Team
    FROM playerrushing
	WHERE PlayerName LIKE CONCAT('%',playerNameToFind,'%')
      ORDER BY CASE WHEN Pos = 'QB' THEN 1
				  WHEN Pos = 'FB' THEN 2
				  WHEN Pos = 'RB' THEN 3
				  WHEN Pos = 'TE' THEN 4
                  WHEN Pos = 'WR' THEN 5
                  ELSE 6 END;
    
END ;;
DELIMITER ;
