FROM
(
	SELECT playerName, Yds, TD, YdsGame
    FROM playerpassing
    WHERE playername = playernametofind
    UNION ALL
	SELECT playerName, Yds, TD, YdsGame
    FROM playerrushing
    WHERE playername = playernametofind
    UNION ALL
	SELECT playerName, Yds, TD, YdsGame
    FROM playerreceiving
    WHERE playername = playernametofind
) AS results; 
END ;;
