CREATE DEFINER=`root`@`localhost` PROCEDURE `searchTeamRoster`(IN teamName VARCHAR(255))
BEGIN
	SELECT Distinct(PlayerName), Pos
    FROM playerreceiving Rec
    WHERE team = teamName
    UNION
    SELECT Distinct(PlayerName), Pos
    FROM playerpassing Pass
    WHERE team = teamName
